import "./Photo.css";

function Photo() {
  return (
    <img
      src="https://media.licdn.com/dms/image/D5603AQE2PhIxpNS4_A/profile-displayphoto-shrink_800_800/0/1678910130257?e=1684972800&v=beta&t=y80QpZKISguEoIJ54ZPY11SNLipSyLiXTeNWPK8roIg"
      alt="Ruslan Karaneuski"
    />
  );
}

export default Photo;
